values:
Okay, well. Today I went out to go look at rims but me and my mom just ended up going to the Honda Dealership and walked around the lot to look at the new 2006's... I LOVED the civics... but the accords didn't impress me. SOOO, then we went out to eat at Papa Gino's. Then we came home and a few hours later we went to Olive Garden and ate for my b-day. I am stuffed. So then I called Jeremy and he is probably gonna come over =] 

Okay. I am gonna go &hearts;

<B>3 DAYS TILL MY B-DAY!!!</B>

IT IS SO FRIGGEN COLD!!! Well, its not really that cold outside, I am just freezing cuz I am sick with a friggen cold. So I am sitting here all wrapped up in my lil blanky and I am shivering and uhhg... Its cold...

Thats all I have to say about that

&hearts;

I just finished all my weork in computers and I am chillin w/ Sheila. idk what else to say really. I just felt like updating cuz I am bored...

-- BY THE WAY mom, just thought I would say HI and amuse u a lil bit while your reading this. KISSES!!! =]

&hearts;

I have just been runnin around the past 2 days. Rediculous. Thank god for other ppl driving. I would deff be even more tired.

idk, I got madd English HW and I just wanna shoot myself! 

&hearts;

I am trying to be a perfect lil angle so that my groundation will end earlier. I brought home a great progress report today so that helped a lot. So all I have to do is be a good girl for the next like, few weeks and I will be able to go anywhere and do anything once again. HAHA! Look out Coventry, I'm comin... Time is your biggest race. Anyway... I am not excited about tomorrow. I am not gonna be at home all day which sucks. I have to go to school all day, then a 3 hour drivers ed class, then I have to go to practice till 8:30 right after Drivers Ed. Then I'll probably call Jeremy and see if he wants to hang out but he will <B>PROBABLY</B>. Doesn't bother me. He can do what he wants. And then sleep innn for the weeeeekkkkeeennnnddd! Cuz I ain't going anywhere. I am missing a big party at Matt's too. It's for his 18th b-day and I am gonna miss it. I am so sad <B>='-(</B> 

yea...Today sucked pretty much...

&hearts;

I can't go out anywhere cuz I am grounded. I can't see anyone, I can't so ANYTHING. This sucks big balls. Its pouring outside and its MADD cold. I wanna make a new CD btu I have no more blank ones. I am SO bored! Someone rescue me from this torture! Jeremy came over yesturday and we had a god time just being together. Well, at least I had a good time. omg, I love this song I am listening to right now. It is so good. My b-day is in like, 2 weeks or something like that. What ya'll gettin me! JUST kidding. I don't want anything from anyone. This was a crappy 3 day weekend. It was cold and rainy and wet and gross. I never thought I would hear myself saying this but I wanna go back to school tomorrow. 

Gonna go. I am leaving to go to Cardies Furniture with my mom and Aunt... and no there won't be a repeat of the honda incident that happened a few years ago... lmao... Only like, Kelsey knows that story cuz I called her right after it happened haha

&hearts;

Dammnn, that was fuckin BORING.. Actually, it wasn't all that bad. I was enjoying myself a bit. w/e. Umm. yea thats about it. I wanna buy Jeff Gofton's rims, but I guess he doesn't have a price on them yet or w/e or he isn't sure if he is selling them. Hey, if they look good on his car they should look good on mine, considering they are the same exact thing... 

nothing else better to say...

&hearts;

okay, well. I am rediculously BORED. I am gonna see if Jeremy wants to go out and do something. Like a picnic or something lmao.  That would be cute. idk, I'll figure out something. I wanna see him one more time this weekend. Last night I went out with Dennis and Jess and I stole an Air Horn from Wal*Mart and I was blowing it out Dennis's car the whole way home. omg it was so funny. I blew it at some people at the bar that were standing outside. It was maddd funny! well, thats all I have to say.

&hearts;

24 days till my b-day!

Well, last night was okay I guess. It wasn't AS fun as I expected it to be but it was still alright. Jeremy was like, 30 mins late getting to Alyssa's house lol, w/e. We blazed, went to the dance and I was all fucked up and trying to find him in the crowd for like an hour. Supposedly e was sitting down. w/e. Anyway, we left the dance, he cashed his check, he put gas in his car, went to the races for like, 20 minutes, and we went back to his house. I ended up sleeping there and that was good. Then I came home. We stayed up like half the night. It was all good. Still not back together. Guess I didn't get my Homecoming wish, but its the closest I can get. I have practice today, 1-4. I am gonna be killing myself.

gonna go take a shower and think about MADD shyt...

Linds&hearts;
